// Solution 1:
const swap = (arr, i, j) => {
    let temp = arr[i];
    arr[i] = arr[j];
    arr[j] = temp;
}

const moveElementToEnd = (arr, toMove) => {
    let leftIdx = 0;
    for(let rightIdx = 0; rightIdx < arr.length; rightIdx++) {
        if(arr[rightIdx]!== toMove) {
            swap(arr, leftIdx, rightIdx);
            leftIdx++;
        }
    }
};

// Do not edit the line below.
exports.moveElementToEnd = moveElementToEnd;
